# CONSANTS:

.eqv BASE_ADDRESS 0x10008000
.eqv SCREEN_SIZE 0x010000 # Set screen size to 512 * 512 / 4 = 65536
.eqv RUN_SPEED 8
.eqv JUMP_HEIGHT 7
