.eqv LEFT_JUMP_KEY 0x71 # q for left jump
.eqv JUMP_KEY 0x77 # w for jump
.eqv CLIMB_KEY 0x35 # 5 for climb
.eqv CLIMB_UP_KEY 0x77 # w for climb up
.eqv CLIMB_DOWN_KEY 0x78 # x for climb down

.eqv NEXT_KEY 0x78 # x for last key
.eqv LAST_KEY 0x63 # c for next key

