START_MENU:
	
	DRAW_SCREEN:
		la $t1, LEVEL
		lw $t1, 0($t1)
		
		beq $t1, 0, DRAW_START_SCREEN
		beq $t1, -1, DRAW_MOVEMENT_SCREEN
		beq $t1, -2, DRAW_DASHING_SCREEN
		beq $t1, -3, DRAW_PICKUP_SCREEN
		j START_MENU_INPUT
		
			DRAW_START_SCREEN:
				la $t1, START_SCREEN
				li $t2, 0
				li $t3, 65536
				
				DRAW_START_SCREEN_LOOP:
					beq $t2, $t3, START_MENU_INPUT
					lw $t4, 0($t1)
					addi $t5, $t2, BASE_ADDRESS
					sw $t4, 0($t5)
					addi $t2, $t2, 4
					addi $t1, $t1, 4
					j DRAW_START_SCREEN_LOOP 
			
			DRAW_MOVEMENT_SCREEN:
				la $t1, MOVEMENT_SCREEN
				li $t2, 0
				li $t3, 65536
				
				DRAW_MOVEMENT_SCREEN_LOOP:
					beq $t2, $t3, START_MENU_INPUT
					lw $t4, 0($t1)
					addi $t5, $t2, BASE_ADDRESS
					sw $t4, 0($t5)
					addi $t2, $t2, 4
					addi $t1, $t1, 4
					j DRAW_MOVEMENT_SCREEN_LOOP 
			
			DRAW_DASHING_SCREEN:
				la $t1, DASHING_SCREEN
				li $t2, 0
				li $t3, 65536
				
				DRAW_DASHING_SCREEN_LOOP:
					beq $t2, $t3, START_MENU_INPUT
					lw $t4, 0($t1)
					addi $t5, $t2, BASE_ADDRESS
					sw $t4, 0($t5)
					addi $t2, $t2, 4
					addi $t1, $t1, 4
					j DRAW_DASHING_SCREEN_LOOP 
				
			DRAW_PICKUP_SCREEN:
				la $t1, PICKUPS_SCREEN
				li $t2, 0
				li $t3, 65536
				
				DRAW_PICKUP_SCREEN_LOOP:
					beq $t2, $t3, START_MENU_INPUT
					lw $t4, 0($t1)
					addi $t5, $t2, BASE_ADDRESS
					sw $t4, 0($t5)
					addi $t2, $t2, 4
					addi $t1, $t1, 4
					j DRAW_PICKUP_SCREEN_LOOP 
										
	START_MENU_INPUT:
		
		li $t1, 0xffff0000
		lw $t2, 4($t1)
		beq $t2, NEXT_KEY, NEXT_SCREEN
		beq $t2, LAST_KEY, LAST_SCREEN
		j START_MENU_INPUT
		
		LAST_SCREEN:
			sw $zero, 4($t1)
			la $t2, LEVEL
			lw $t3, 0($t2)
			beq $t3, -3, START_MENU_INPUT
			addi $t3, $t3, -1
			sw $t3, 0($t2)
			j DRAW_SCREEN
		
		NEXT_SCREEN:
			sw $zero, 4($t1)
			la $t2, LEVEL
			lw $t3, 0($t2)
			addi $t3, $t3, 1
			sw $t3, 0($t2)
			beq $t3, 1, INITIAL_SETUP
			j DRAW_SCREEN
					
	j START_MENU_INPUT

INITIAL_SETUP:
	li $t0, BASE_ADDRESS # $t0 stores the base address for display
	la $s0, PLAYER_INFO # Store player info in $s0
	
	RESET_GAME:
		
		# Reset WINGS_LOC
		la $t1, WINGS_LOC
		li $t2, 0
		
		RESET_WINGS_LOOP:
			beq $t2, 12, RESET_WINGS_LOOP_END
			sw $zero, 0($t1)
			addi $t1, $t1, 4
			addi $t2, $t2, 1
			j RESET_WINGS_LOOP
			
		RESET_WINGS_LOOP_END:	
		li $t1, 0x0ffffff # $t1 stores the white purple colour code
		li $t2, 0 #Initialize counter for loop
		li $t3, SCREEN_SIZE #Store address of final pixel in $t3
		li $t5, 0
	 
		RESET_GAME_LOOP:
			bge $t2, $t3, HEADER_SETUP # When we reach the bottom right, stop the loop
			add $t4, $t2, $t0 #Store address of A[i] in $t4
			sw $t1, 0($t4) # Change the colour of the ith pixel to aqua
			addi $t2, $t2, 4 # Increment i by 4
			beq $t5, 128, RESET_WAIT
			addi $t5, $t5, 1
			j RESET_GAME_LOOP
			
			RESET_WAIT:
				li $v0, 32
				li $a0, 1
				syscall
				li $t5, 0
				j RESET_GAME_LOOP
			
	HEADER_SETUP:
		li $t1, 0x0000000 # $t1 stores the dark purple colour code
		li $t2, 0 #Initialize counter for loop
		li $t3, 3584 #Store address of final pixel in $t3
	
		HEADER_SETUP_LOOP:
			bge $t2, $t3, HEADER_SCORE_SETUP # When we reach the bottom right, stop the loop
			add $t4, $t2, $t0 #Store address of A[i] in $t4
			sw $t1, 0($t4) # Change the colour of the ith pixel to aqua
			addi $t2, $t2, 4 # Increment i by 4
			j HEADER_SETUP_LOOP
			
		HEADER_SCORE_SETUP: #Draw the SCORE: part of the header
			#Draw S
			li $t1, 0x0ffffff
			li $t2, 516
			add $t2, $t2, $t0
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, 504
			sw $t1, 0($t2)
			addi $t2, $t2, 512
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, 512
			sw $t1, 0($t2)
			addi $t2, $t2, 512
			sw $t1, 0($t2)
			addi $t2, $t2, -4
			sw $t1, 0($t2)
			addi $t2, $t2, -4
			sw $t1, 0($t2)
			
			# Draw C
			addi $t2, $t2, 16
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, 4
			sw $t1, 0($t2)
			addi $t2, $t2, -520
			sw $t1, 0($t2)
			addi $t2, $t2, -512
