	BG_SETUP:
		li $t1, 0x03f0c75 # $t1 stores the dark purple colour code
		li $t2, 3584 #Initialize counter for loop
		li $t3, SCREEN_SIZE #Store address of final pixel in $t3
	
		BG_SETUP_LOOP:
			bge $t2, $t3, BORDER_SETUP # When we reach the bottom right, stop the loop
			add $t4, $t2, $t0 #Store address of A[i] in $t4
			sw $t1, 0($t4) # Change the colour of the ith pixel to aqua
			addi $t2, $t2, 4 # Increment i by 4
			j BG_SETUP_LOOP
		
	BORDER_SETUP:
		li $t1, BORDER # $t1 stores the border color code
		
		BORDER_SETUP_TOP:
			li $t2, 3584 # Start at the top left
			li $t3, 5632 # Go until the end of the fourth row
			
			BORDER_SETUP_LOOP_TOP:
				bge $t2, $t3, BORDER_SETUP_LEFT # When we reach the end of the second row, stop the loop
				add $t4, $t2, $t0 #Store address of A[i] in $t4
				sw $t1, 0($t4) # Change the colour of the ith pixel to aqua
				addi $t2, $t2, 4 # Increment i by 4
				j BORDER_SETUP_LOOP_TOP
				
				
		BORDER_SETUP_LEFT:
			li $t2, 3584 # Start at the fifth row
			li $t3, 62992 # Go until the end of the fourth column
			li $t5, 0 # Keep track of how many pixels coloured
			
			BORDER_SETUP_LOOP_LEFT:
				bge $t2, $t3, BORDER_SETUP_RIGHT # When we reach the end
				add $t4, $t2, $t0 #Store address of A[i] in $t4
				sw $t1, 0($t4) # Change the colour of the ith pixel to dark purple
				addi $t5, $t5, 1
				
				beq $t5, 4, BORDER_SETUP_LOOP_LEFT_NEXT_ROW
				addi $t2, $t2, 4 # Increment i by 4 
				j BORDER_SETUP_LOOP_LEFT
				
					BORDER_SETUP_LOOP_LEFT_NEXT_ROW:
						addi $t2, $t2, 500 # Increment i to the next row
						li $t5, 0
						j BORDER_SETUP_LOOP_LEFT
						
		BORDER_SETUP_RIGHT:
			li $t2, 4080 # Start near the end of the fifth row
			li $t3, 63488 # Go until the end of the fourth last column
			li $t5, 0 # Keep track of how many pixels coloured
			
			BORDER_SETUP_LOOP_RIGHT:
				bge $t2, $t3, BORDER_SETUP_BOTTOM # When we reach the end
				add $t4, $t2, $t0 #Store address of A[i] in $t4
				sw $t1, 0($t4) # Change the colour of the ith pixel to dark purple
				addi $t5, $t5, 1
				
				beq $t5, 4, BORDER_SETUP_LOOP_RIGHT_NEXT_ROW
				addi $t2, $t2, 4 # Increment i by 4 
				j BORDER_SETUP_LOOP_RIGHT
				
					BORDER_SETUP_LOOP_RIGHT_NEXT_ROW:
						addi $t2, $t2, 500 # Increment i to the next row
						li $t5, 0
						j BORDER_SETUP_LOOP_RIGHT
			
		BORDER_SETUP_BOTTOM:	
			li $t2, 63488 #Initialize counter for loop to start at fourth last row
			li $t3, SCREEN_SIZE # Go until the end
			
			BORDER_SETUP_LOOP_BOTTOM:
				bge $t2, $t3, LEVEL_SETUP # When we reach the end of the second row, stop the loop
				add $t4, $t2, $t0 #Store address of A[i] in $t4
				sw $t1, 0($t4) # Change the colour of the ith pixel to aqua
				addi $t2, $t2, 4 # Increment i by 4
				j BORDER_SETUP_LOOP_BOTTOM
				
				
