		lw $a0, 0($s0)  # Sets the initial spawn of the character to the bottom left corner
		li $a1, 0 # Makes the character face to the right
		li $a2, 0 # Sets the state to idle
		jal DRAW_CHARACTER
		j INITIAL_SETUP_END

INITIAL_SETUP_END:

MAIN_GAME_LOOP:


	lw $s2, STATE($s0)
	
	RESPAWN_WINGS_CHECK:
		
		la $t1, WINGS_LOC
		la $t2, WINGS_TIMER
		li $t3, WING_COLOR
		li $t4, 0
		
		RESPAWN_WINGS_CHECK_LOOP:
			beq $t4, 12, CLIMB_CHECK
			# If the location of the wing is zero, we are not drawing it
			lw $t5, 0($t1)
			beqz $t5, CLIMB_CHECK
			# If the location is not zero, check its timer
			lw $t5, 0($t2)
			# If the timer is zero, it is already drawn. No need to redraw. Repeat loop
			beqz $t5, RESPAWN_WINGS_CHECK_LOOP_REPEAT
			# If the timer is one, then we need to redraw it. Jump to REDRAW_WING
			beq $t5, 1, REDRAW_WING
			# If timer is greater than one, decrement it
			addi $t5, $t5, -1
			sw $t5, 0($t2)
			# Increment values and repeat loop
			
			RESPAWN_WINGS_CHECK_LOOP_REPEAT:
			
				addi $t1, $t1, 4
				addi $t2, $t2, 4
				addi $t3, $t3, 1
				addi $t4, $t4, 1
				j RESPAWN_WINGS_CHECK_LOOP
			
			REDRAW_WING:
				addi $sp, $sp, -16
				sw $t1, 0($sp)
				sw $t2, 4($sp)
				sw $t3, 8($sp)
				sw $t4, 12($sp)
				
				lw $a0, POSITION($s0)
				jal CLEAR_CHARACTER
				
				lw $t1, 0($sp)
				lw $t2, 4($sp)
				lw $t3, 8($sp)
				lw $t4, 12($sp)
				addi $sp, $sp, 16
				
				#Set wings' timer to 0
				li $t5, 0
				sw $t5, 0($t2)
				# Redraw the wing and character
				addi $sp, $sp, -16
				sw $t1, 0($sp)
				sw $t2, 4($sp)
				sw $t3, 8($sp)
				sw $t4, 12($sp)
				
				lw $a0, 0($t1)
				move $a1, $t3
				jal DRAW_WINGS
					
				lw $a0, POSITION($s0)
				lw $a1, DIRECTION($s0)
				lw $a2, STATE($s0)
				jal DRAW_CHARACTER
				
				lw $t1, 0($sp)
				lw $t2, 4($sp)
				lw $t3, 8($sp)
				lw $t4, 12($sp)
				addi $sp, $sp, 16
				
				addi $t1, $t1, 4
				addi $t2, $t2, 4
				addi $t3, $t3, 1
				addi $t4, $t4, 1
				
				j RESPAWN_WINGS_CHECK_LOOP
	
	CLIMB_CHECK:
		lw $t1, STATE($s0)
		bne $t1, 2, DASH_CHECK  # If we are not in climb state, go to dash check. If we are in climb state, check for and respond to input.
		
		CLIMB_INPUT_CHECK:
			# Get the most recent input
			li $t1, 0xffff0000
			lw $t2, 4($t1)
			
			beq $t2, CLIMB_KEY, END_CLIMB #If the climb key is pressed while we are climbing, stop climbing
			beq $t2, CLIMB_UP_KEY, CLIMB_UP # If the climb up key is pressed, climb up
			beq $t2, CLIMB_DOWN_KEY, CLIMB_DOWN # If the climb down key is pressed, climb down
			
			j DASH_CHECK
			
				CLIMB_DOWN:
				
					#Stop climbing down if there is a floor below
					lw $t1, 0($s0)
					add $t1, $t1, $t0
					addi $t1, $t1, 3584
					lw $t1, 0($t1)
					beq $t1, BORDER, DASH_CHECK
					beq $t1, PLATFORM, DASH_CHECK
					beq $t1, PLATFORMX, DASH_CHECK
					
					lw $t1, DIRECTION($s0)
					beqz $t1, CLIMB_DOWN_RIGHT_CHECK
					
					CLIMB_DOWN_LEFT_CHECK:
						# If we climbing down a wall to the left, make sure there is enough wall to climb down
						lw $t1, POSITION($s0)
						add $t1, $t1, $t0
						addi $t1, $t1, 3056
						lw $t1, 0($t1)
						beq $t1, BORDER, CLIMB_DOWN_CONTINUE
						beq $t1, PLATFORM, CLIMB_DOWN_CONTINUE
						beq $t1, PLATFORMX, CLIMB_DOWN_CONTINUE
						j DASH_CHECK
					
					CLIMB_DOWN_RIGHT_CHECK:
						# If we climbing down a wall to the left, make sure there is enough wall to climb down
						lw $t1, POSITION($s0)
						add $t1, $t1, $t0
						addi $t1, $t1, 3088
						lw $t1, 0($t1)
						beq $t1, BORDER, CLIMB_DOWN_CONTINUE
						beq $t1, PLATFORM, CLIMB_DOWN_CONTINUE
						beq $t1, PLATFORMX, CLIMB_DOWN_CONTINUE
						j DASH_CHECK
					
					CLIMB_DOWN_CONTINUE:
					lw $t1, 0($s0)
					move $a0, $t1
					jal CLEAR_CHARACTER
					
					addi $t1, $t1, 512
					sw $t1, 0($s0)
					move $a0, $t1
					li $t1, 1
					sw $t1, CLIMB_DIR($s0) #Set climb direction to down
					
					li $a2, 2 #Set state to climbing for argument
					
					jal DRAW_CHARACTER
					
					j DASH_CHECK
				
				CLIMB_UP:
				
					#Stop climbing up if there is a ceiling above
					lw $t1, 0($s0)
					add $t1, $t1, $t0
					addi $t1, $t1, -3584
					lw $t1, 0($t1)
					beq $t1, BORDER, DASH_CHECK
					beq $t1, PLATFORM, DASH_CHECK
					beq $t1, PLATFORMX, DASH_CHECK
					
					lw $t1, DIRECTION($s0)
					beqz $t1, CLIMB_UP_RIGHT_CHECK
					
					CLIMB_UP_LEFT_CHECK:
						# If we climbing down a wall to the left, make sure there is enough wall to climb down
						lw $t1, POSITION($s0)
						add $t1, $t1, $t0
						addi $t1, $t1, -528
						lw $t1, 0($t1)
						beq $t1, BORDER, CLIMB_UP_CONTINUE
						beq $t1, PLATFORM, CLIMB_UP_CONTINUE
						beq $t1, PLATFORMX, CLIMB_UP_CONTINUE
						j DASH_CHECK
					
					CLIMB_UP_RIGHT_CHECK:
						# If we climbing down a wall to the left, make sure there is enough wall to climb down
						lw $t1, POSITION($s0)
						add $t1, $t1, $t0
						addi $t1, $t1, -496
						lw $t1, 0($t1)
						beq $t1, BORDER, CLIMB_UP_CONTINUE
						beq $t1, PLATFORM, CLIMB_UP_CONTINUE
						beq $t1, PLATFORMX, CLIMB_UP_CONTINUE
						j DASH_CHECK
					
					CLIMB_UP_CONTINUE:
					lw $t1, 0($s0)
					move $a0, $t1
					jal CLEAR_CHARACTER
					
					addi $t1, $t1, -512
					sw $t1, 0($s0)
					move $a0, $t1
					li $t1, 1
					sw $t1, CLIMB_DIR($s0) #Set climb direction to down
					
					li $a2, 2 #Set state to climbing for argument
					
					jal DRAW_CHARACTER
					
					j DASH_CHECK
				
				
				END_CLIMB:
					sw $zero, 4($t1) # Reset the input
					li $t1, 0
					sw $t1, STATE($s0)
					li $t1, -1
					sw $t1, IS_JUMP($s0)
					
					lw $a0, POSITION($s0)
					lw $a1, DIRECTION($s0)
					lw $a2, STATE($s0)
					jal CLEAR_CHARACTER
					jal DRAW_CHARACTER
					
					j FALL_CHECK

	DASH_CHECK: #If we are mid-dash, make the character go in the correct direction as determined by DASH_X and DASH_Y
		lw $t1, STATE($s0)
		bne $t1, 4, JUMP_CHECK  # If we are not in dash state, go to jump check. If we are in dash state, move in the correct direction
		
		INCREMENT_DASH:
			
			lw $t1, FRAMES($s0)
			beq $t1, DASH_TIME, END_DASH 
			lw $a0, 0($s0)
			jal CLEAR_CHARACTER
			
			li $t1, 0 # Initialize counter for loop
			lw $t2, DASH_X($s0)
			lw $t3, DASH_Y($s0)
			sll $t2, $t2, 2
			sll $t3, $t3, 9
			li $t7, 0
			li $t8, 0
	
			
				DASH_LOOP:
					beq $t1, 7, DASH_END_LOOP
					
					# Ensure there is no collision in the x direction
					lw $t4, POSITION($s0)
					addi $t4, $t4, BASE_ADDRESS
					
					add $t4, $t4, $t2
					lw $t5, DASH_X($s0)
					li $t6, 12
					mult $t5, $t6
					mflo $t5
					add $t4, $t4, $t5
					addi $t6, $t4, 1024
					addi $t7, $t4, -1024
						
					DASH_X_INNER_LOOP:
						bgt $t7, $t6, DASH_LOOP_CONTINUE
						lw $t4, 0($t7)
						beq $t4, BORDER, STOP_X_MOVE
						beq $t4, PLATFORM, STOP_X_MOVE
						addi $t7, $t7, 512
						j DASH_X_INNER_LOOP
						
						STOP_X_MOVE:
							lw $t5, DASH_X($s0)
							sll $t5, $t5, 2
							sub $t2, $t2, $t5
							
					DASH_LOOP_CONTINUE:
					# Ensure there is no collision in the y direction
					lw $t4, POSITION($s0)
					addi $t4, $t4, BASE_ADDRESS
					add $t4, $t4, $t3 
					lw $t5, DASH_Y($s0)
					li $t6, 1536
					mult $t5, $t6
					mflo $t5
					add $t4, $t4, $t5
					addi $t6, $t4, 8
					addi $t7, $t4, -8
						
					DASH_Y_INNER_LOOP:
						bgt $t7, $t6, DASH_LOOP_CONTINUE_2
						lw $t4, 0($t7)
						beq $t4, BORDER, STOP_Y_MOVE
						beq $t4, PLATFORM, STOP_Y_MOVE
						addi $t7, $t7, 4
						j DASH_Y_INNER_LOOP
						
						STOP_Y_MOVE:
							lw $t5, DASH_Y($s0)
							sll $t5, $t5, 9
							sub $t3, $t3, $t5
							
					DASH_LOOP_CONTINUE_2:
					move $t7, $t2
					lw $t5, DASH_X($s0)
					sll $t5, $t5, 2
					add $t2, $t2, $t5
					
					move $t8, $t3
					lw $t5, DASH_Y($s0)
					sll $t5, $t5, 9
					add $t3, $t3, $t5
					
					addi $t1, $t1, 1
					
					j DASH_LOOP
				
				DASH_END_LOOP:
					lw $a0, 0($s0)
					add $a0, $a0, $t7
					add $a0, $a0, $t8
					sw $a0, POSITION($s0)
					jal DRAW_CHARACTER
					j COLLISION_CHECK
			
			END_DASH:
	
				sw $zero, STATE($s0)
				sw $zero, FRAMES($s0)
				lw $t1, DASH_X($s0)
				beq $t1, -1, END_DASH_LEFT #When the dash ends, make the character face the direction of the dash
				
				j JUMP_CHECK
					END_DASH_LEFT:
					li $t1, 1
					sw $t1, DIRECTION($s0)

	JUMP_CHECK: # If we are mid-jump, then make the character go up
		lw $t1, IS_JUMP($s0)
		beqz $t1, INPUT_CHECK  # If we are not in jump state, go to input check. If we are in jump state, increment the jump frame counter
		beq $t1, -1, INPUT_CHECK
		
		INCREMENT_JUMP:
			
			lw $s2, 24($s0)
			li $t3, JUMP_HEIGHT
			beq $s2, $t3, END_JUMP
			addi $s2, $s2, 1
			sw $s2, 24($s0)
			move $t1, $s2
			sub $t1, $t3, $t1
			sll $t1, $t1, 9
			lw $a0, 0($s0)
			jal CLEAR_CHARACTER
			
			li $t4, -12
			
			INCREMENT_JUMP_OUTER_LOOP:
				beq $t4, 16, INCREMENT_JUMP_END_OUTER_LOOP
				li $t2, 0
			
				INCREMENT_JUMP_INNER_LOOP:
					beq $t2, $t1, INCREMENT_JUMP_END_INNER_LOOP
					lw $t3, POSITION($s0)
					sub $t3, $t3, $t2
					addi $t3, $t3, -3072
					add $t3, $t3, $t0
					add $t3, $t3, $t4
					lw $t3, 0($t3)
					beq $t3, BORDER, INCREMENT_JUMP_END_OUTER_LOOP
					beq $t3, PLATFORM, INCREMENT_JUMP_END_OUTER_LOOP
					beq $t3, PLATFORMX, INCREMENT_JUMP_END_OUTER_LOOP
					addi $t2, $t2, 512
					j INCREMENT_JUMP_INNER_LOOP
					
				INCREMENT_JUMP_END_INNER_LOOP:
					addi $t4, $t4, 4
					j INCREMENT_JUMP_OUTER_LOOP
			
			INCREMENT_JUMP_END_OUTER_LOOP:
			sub $a0, $a0, $t2
			sw $a0, 0($s0)
			
			jal DRAW_CHARACTER
			j INPUT_CHECK
			
			END_JUMP:
	
				li $t1, 0
				sw $t1, 20($s0) # Set IS_JUMP to -1 for falling
				sw $zero, 24($s0)

	INPUT_CHECK:
		# Get the most recent input

		#la $t1, INPUT_BUFFER
		#li $t3, 0
		#li $t4, 4
		#
