		#	lw $t2, 0($t6)
		#	sw $t2, 0($t5)
		#	addi $t3, $t3, 4
		#	addi $t4, $t4, 4
		#	j INPUT_BUFFER_LOOP
		#
		#INPUT_BUFFER_LOOP_END:
		#
		#add $t5, $t3, $t1
	
		li $t1, 0xffff0000
		lw $t2, 4($t1)

		#sw $t2, 0($t5)
		#
		#la $t2, INPUT_BUFFER
		#	
		#li $t3, INPUT_BUFFER_LEN
		#addi $t3, $t3, -4
		#
		#INPUT_BUFFER_CHECK_LOOP:
		#	bltz $t3, INPUT_BUFFER_CHECK_LOOP_END
		#	add $t4, $t3, $t2
		#	lw $t4, 0($t4)
		#	bnez $t4, INPUT_BUFFER_CHECK_LOOP_END
		#	addi $t3, $t3, -4
		#	j INPUT_BUFFER_CHECK_LOOP
		#
		#INPUT_BUFFER_CHECK_LOOP_END:
		#move $t2, $t4
		
		lw $t3, STATE($s0)
		beq $t3, 2, SKIP_MOVE_JUMP # If we are climbing, skip the jump input, as w is used for moving up during climbing. Also skip move left and right
		
		#Branch to correct movement branch based on input
		beq $t2, LEFT_KEY, MOVE_LEFT # If a is pressed
		beq $t2, RIGHT_KEY, MOVE_RIGHT # If d is pressed
		beq $t2, JUMP_KEY, JUMP # If w is pressed
		
		SKIP_MOVE_JUMP:
		beq $t2, RIGHT_JUMP_KEY, JUMP_RIGHT # If e is pressed
		beq $t2, LEFT_JUMP_KEY, JUMP_LEFT # If q is pressed
		
		# Dash Buttons
		beq $t2, UP_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, DOWN_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, LEFT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, RIGHT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, UP_LEFT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, DOWN_LEFT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, UP_RIGHT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		beq $t2, DOWN_RIGHT_DASH_KEY, DASH_CONTROL # If 8 is pressed
		
		beq $t2, CLIMB_KEY, CLIMB
		
		beq $t2, RESET_KEY, RESET
		beq $t2, FULL_RESET_KEY, RESET
		
		j NO_INPUT
		
			MOVE_RIGHT:
				#sw $zero, 4($t1) #Reset input
				lw $a0, 0($s0) 
				li $t5, -3072
				
				MOVE_RIGHT_OUTER_LOOP:
					
					beq $t5, 3584, MOVE_RIGHT_END_OUTER_LOOP
					li $t1, 0
					li $t2, RUN_SPEED
					addi $t2, $t2, 4
					
					MOVE_RIGHT_INNER_LOOP:
						beq $t1, $t2, MOVE_RIGHT_END_INNER_LOOP
						li $t3, 16
						add $t3, $t3, $t1
						add $t4, $a0, $t3
						add $t4, $t0, $t4
						add $t4, $t4, $t5
						lw $t4, 0($t4)
						beq $t4, BORDER, MOVE_RIGHT_END_OUTER_LOOP
						beq $t4, PLATFORM, MOVE_RIGHT_END_OUTER_LOOP
						beq $t4, PLATFORMX, MOVE_RIGHT_END_OUTER_LOOP
						addi $t1, $t1, 4
						j MOVE_RIGHT_INNER_LOOP
						
					MOVE_RIGHT_END_INNER_LOOP:
					
					addi $t5, $t5, 512
					j MOVE_RIGHT_OUTER_LOOP
					
				MOVE_RIGHT_END_OUTER_LOOP:
				
					subi $t3, $t3, 16
					add $s3, $a0, $t3
					sw $s3, 0($s0)

					jal CLEAR_CHARACTER
					
					move $a0, $s3
					
					li $a1, 0 # Set direction to right
					sw $a1, 4($s0)

					li $a2, 1 # Set state to run
					sw $a2, 8($s0)
					
					jal DRAW_CHARACTER
					
					j FALL_CHECK
					
			MOVE_LEFT:
				#sw $zero, 4($t1) #Reset input
				lw $a0, 0($s0) 
				li $t5, -3072
				
				MOVE_LEFT_OUTER_LOOP:
					
					beq $t5, 3584, MOVE_LEFT_END_OUTER_LOOP
					li $t1, 0
					li $t2, -RUN_SPEED
					addi $t2, $t2, -4
					
					MOVE_LEFT_INNER_LOOP:
						beq $t1, $t2, MOVE_LEFT_END_INNER_LOOP
						li $t3, -16
						add $t3, $t3, $t1
						add $t4, $a0, $t3
						add $t4, $t0, $t4
						add $t4, $t4, $t5
						lw $t4, 0($t4)
						beq $t4, BORDER, MOVE_LEFT_END_OUTER_LOOP
						beq $t4, PLATFORM, MOVE_LEFT_END_OUTER_LOOP
						beq $t4, PLATFORMX, MOVE_LEFT_END_OUTER_LOOP
						addi $t1, $t1, -4
						j MOVE_LEFT_INNER_LOOP
						
					MOVE_LEFT_END_INNER_LOOP:
					
					addi $t5, $t5, 512
					j MOVE_LEFT_OUTER_LOOP
					
				MOVE_LEFT_END_OUTER_LOOP:
					addi $t3, $t3, 16
					add $s3, $a0, $t3
					sw $s3, 0($s0)
					
					jal CLEAR_CHARACTER
					move $a0, $s3
					li $a1, 1 # Set direction to left
					sw $a1, 4($s0)
					
					li $a2, 1 # Set state to run
					sw $a2, 8($s0)
					
					jal DRAW_CHARACTER
					
					j FALL_CHECK
					
			NO_INPUT:
				lw $t1, 8($s0)
				beq $t1, -1, FALL_CHECK
				beq $t1, 2, FALL_CHECK
				bnez $t1, SET_IDLE
				j FALL_CHECK
				
				SET_IDLE:
					lw $a0, 0($s0) 
					jal CLEAR_CHARACTER
					li $a2, 0 # Set state to idle
					sw $a2, 8($s0)
					jal DRAW_CHARACTER
						j FALL_CHECK
			JUMP:
				sw $zero, 4($t1) #Reset input
				lw $t1, 20($s0) #Get the current state
				bnez $t1, FALL_CHECK # If they are already in the jump state, go to fall check
				
				# Check all the pixels under the character. If any of them are walkable, we can jump
				li $t3, -8
				JUMP_LOOP:
					beq $t3, 12, FALL_CHECK #If we reach the end of the loop, there is not walkable pixels, so we cannot jump. Go to FALL_CHECK
					lw $t1, 0($s0) # Get the colour of the pixel underneath the character
					addi $t1, $t1, 4096
					add $t1, $t0, $t1
					add $t1, $t1, $t3
					lw $t1, 0($t1)
					beq $t1, BORDER, JUMP_CONTINUE #If we are on the ground, we can jump. Go to JUMP_CONTINUE
					beq $t1, PLATFORM, JUMP_CONTINUE
					beq $t1, PLATFORMX, JUMP_CONTINUE
					addi $t3, $t3, 4
					j JUMP_LOOP
				
				JUMP_CONTINUE:
				li $t1, 1 #If we are not in jump state, and we are on the ground, then enter jump state.
				sw $t1, 20($s0)
				sw $zero, 24($s0)
				
				j FALL_CHECK
				
			JUMP_RIGHT:
				li $t2, 0x64
				sw $t2, 4($t1) #Set input to go right
				lw $t1, IS_JUMP($s0) #Get the current jump state
				beq $t1, 1, FALL_CHECK # If they are already in the jump state, go to fall check
				
