				addi $t1, $t1, -16
				add $t1, $t1, $t0
				lw $t1, 0($t1)
				beq $t1, BORDER, JUMP_RIGHT_CONTINUE # If we are against a wall, we can wall jump
				beq $t1, PLATFORM, JUMP_RIGHT_CONTINUE
				beq $t1, PLATFORMX, JUMP_RIGHT_CONTINUE
				
				# Check all the pixels under the character. If any of them are walkable, we can jump
				li $t3, -8
				JUMP_RIGHT_LOOP:
					beq $t3, 12, FALL_CHECK #If we reach the end of the loop, there is not walkable pixels, so we cannot jump. Go to FALL_CHECK
					lw $t1, 0($s0) # Get the colour of the pixel underneath the character
					addi $t1, $t1, 4096
					add $t1, $t0, $t1
					add $t1, $t1, $t3
					lw $t1, 0($t1)
					beq $t1, BORDER, JUMP_RIGHT_CONTINUE #If we are on the ground, we can jump. Go to JUMP_CONTINUE
					beq $t1, PLATFORM, JUMP_RIGHT_CONTINUE
					beq $t1, PLATFORMX, JUMP_RIGHT_CONTINUE
					addi $t3, $t3, 4
					j JUMP_RIGHT_LOOP
				
				JUMP_RIGHT_CONTINUE:
				li $t1, 1 #If we are not in jump state, and we are on the ground or against a wall, then enter jump state.
				sw $t1, 20($s0)
				sw $zero, 24($s0)
				sw $zero, STATE($s0)
				
				j FALL_CHECK
				
			JUMP_LEFT:
				li $t2, 0x61
				sw $t2, 4($t1) #Set input to go left
				lw $t1, IS_JUMP($s0) #Get the current state
				beq $t1, 1, FALL_CHECK # If they are already in the jump state, go to fall check
				
				lw $t1, 0($s0) # Get the colour of the pixel to the right of the character
				addi $t1, $t1, 16
				add $t1, $t1, $t0
				lw $t1, 0($t1)
				beq $t1, BORDER, JUMP_LEFT_CONTINUE # If we are against a wall, we can wall jump
				beq $t1, PLATFORM, JUMP_LEFT_CONTINUE 
				beq $t1, PLATFORMX, JUMP_LEFT_CONTINUE 
				# Check all the pixels under the character. If any of them are walkable, we can jump
				li $t3, -8
				JUMP_LEFT_LOOP:
					beq $t3, 12, FALL_CHECK #If we reach the end of the loop, there is not walkable pixels, so we cannot jump. Go to FALL_CHECK
					lw $t1, 0($s0) # Get the colour of the pixel underneath the character
					addi $t1, $t1, 4096
					add $t1, $t0, $t1
					add $t1, $t1, $t3
					lw $t1, 0($t1)
					beq $t1, BORDER, JUMP_LEFT_CONTINUE #If we are on the ground, we can jump. Go to JUMP_CONTINUE
					beq $t1, PLATFORM, JUMP_LEFT_CONTINUE
					beq $t1, PLATFORMX, JUMP_LEFT_CONTINUE
					addi $t3, $t3, 4
					j JUMP_LEFT_LOOP
				
				JUMP_LEFT_CONTINUE:
				li $t1, 1 #If we are not in jump state, and we are on the ground, then enter jump state.
				sw $t1, 20($s0)
				sw $zero, 24($s0)
				sw $zero, STATE($s0)
				
				j FALL_CHECK
				
			DASH_CONTROL:
				sw $zero, 4($t1) #Reset input
				lw $t1, 8($s0) #Get the current state
				beq $t1, 4, FALL_CHECK # If they are already in the dash state, go to fall check
			
				lw $t1, DASH_COUNT($s0)
				beqz $t1, FALL_CHECK #If we have no dashes left, go to fall check
				li $t1, 4 #If we are not in dash state, and we have dashes left, enter dash state
				sw $t1, STATE($s0)
				sw $zero, DASH_COUNT($s0) #Set available dashes to 0
				sw $zero, FRAMES($s0) #Reset state frame count
				sw $zero, IS_JUMP($s0) #Exit jump state
				sw $zero, JUMP_FRAMES($s0) #Reset jump frame count
				
				beq $t2, UP_DASH_KEY, DASH_UP # If 8 is pressed
				beq $t2, DOWN_DASH_KEY, DASH_DOWN # If 8 is pressed
				beq $t2, LEFT_DASH_KEY, DASH_LEFT # If 8 is pressed
				beq $t2, RIGHT_DASH_KEY, DASH_RIGHT # If 8 is pressed
				beq $t2, UP_LEFT_DASH_KEY, DASH_UP_LEFT # If 8 is pressed
				beq $t2, UP_RIGHT_DASH_KEY, DASH_UP_RIGHT # If 8 is pressed
				beq $t2, DOWN_LEFT_DASH_KEY, DASH_DOWN_LEFT # If 8 is pressed
				beq $t2, DOWN_RIGHT_DASH_KEY, DASH_DOWN_RIGHT # If 8 is pressed
				
				j FALL_CHECK
				
				DASH_UP:
					li $t1, -1
					sw $t1, DASH_Y($s0) #Set DASH_Y to -1
					sw $zero, DASH_X($s0) #Set DASH_X to 0
					
					j DASH_CONTROL_END
				DASH_DOWN:
					li $t1, 1
					sw $t1, DASH_Y($s0) #Set DASH_Y to 1
					sw $zero, DASH_X($s0) #Set DASH_X to 0
					
					j DASH_CONTROL_END
				DASH_RIGHT:
					li $t1, 1
					sw $t1, DASH_X($s0) #Set DASH_X to 1
					sw $zero, DASH_Y($s0) #Set DASH_Y to 0
					li $t1, 0
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
				DASH_LEFT:
					li $t1, -1
					sw $t1, DASH_X($s0) #Set DASH_X to -1
					sw $zero, DASH_Y($s0) #Set DASH_Y to 0
					li $t1, 1
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
				DASH_UP_LEFT:
					li $t1, -1
					sw $t1, DASH_Y($s0) #Set DASH_Y to -1
					sw $t1, DASH_X($s0) #Set DASH_X to -1
					li $t1, 1
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
				DASH_UP_RIGHT:
					li $t1, -1
					sw $t1, DASH_Y($s0) #Set DASH_Y to -1
					li $t1, 1
					sw $t1, DASH_X($s0) #Set DASH_X to 1
					li $t1, 0
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
				DASH_DOWN_LEFT:
					li $t1, -1
					sw $t1, DASH_X($s0) #Set DASH_X to -1
					li $t1, 1
					sw $t1, DASH_Y($s0) #Set DASH_Y to 1
					li $t1, 1
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
				DASH_DOWN_RIGHT:
					li $t1, 1
					sw $t1, DASH_Y($s0) #Set DASH_Y to 1
					sw $t1, DASH_X($s0) #Set DASH_X to 1
					li $t1, 0
					sw $t1, DIRECTION($s0)
					j DASH_CONTROL_END
			DASH_CONTROL_END:
				
				lw $a0, POSITION($s0)
				lw $a1, DIRECTION($s0)
				lw $a2, STATE($s0)
				jal CLEAR_CHARACTER
				jal DRAW_CHARACTER
				j COLLISION_CHECK
					
			CLIMB:
				sw $zero, 4($t1) #Reset input
				
				lw $t1, DIRECTION($s0)
				beq $t1, 0, RIGHT_CLIMB_CHECK # If we are facing to the right, jump to RIGHT_CLIMB_CHECK. Otherwise, proceed to LEFT_CLIMB_CHECK
				
				
				LEFT_CLIMB_CHECK:
					#Make sure that we are against a wall before climbing
					lw $t1, 0($s0)
					add $t1, $t1, $t0
					addi $t1, $t1, -16
					lw $t1, 0($t1)
					beq $t1, BORDER, LEFT_CLIMB_CHECK_CONTINUE
					beq $t1, PLATFORM, LEFT_CLIMB_CHECK_CONTINUE
					beq $t1, PLATFORMX, LEFT_CLIMB_CHECK_CONTINUE
					j FALL_CHECK
					
					LEFT_CLIMB_CHECK_CONTINUE:
					lw $a0, POSITION($s0)
					jal CLEAR_CHARACTER
					
					li $t1, 2
					sw $t1, STATE($s0) # Set our state to climbing state
					move $a2, $t1
					
					jal DRAW_CHARACTER
					
					j COLLISION_CHECK
				
				RIGHT_CLIMB_CHECK:
					#Make sure that we are against a wall before climbing
					lw $t1, 0($s0)
					add $t1, $t1, $t0
					addi $t1, $t1, 16
					lw $t1, 0($t1)
					beq $t1, BORDER, RIGHT_CLIMB_CHECK_CONTINUE
					beq $t1, PLATFORM, RIGHT_CLIMB_CHECK_CONTINUE
					beq $t1, PLATFORMX, RIGHT_CLIMB_CHECK_CONTINUE
					j FALL_CHECK
					
					RIGHT_CLIMB_CHECK_CONTINUE:
					lw $a0, POSITION($s0)
					jal CLEAR_CHARACTER
					
					li $t1, 2
					sw $t1, STATE($s0) # Set our state to climbing state
					move $a2, $t1
					
					jal DRAW_CHARACTER
					
					j COLLISION_CHECK
					
			RESET:
				# Reset all values to default and restart the level
				li $t1, 0xffff0000
				lw $t3, 4($t1)
				sw $zero, 4($t1)
				li $t1, 59940
				sw $t1, 0($s0)
				sw $zero, 4($s0)
				sw $zero, 8($s0)
				sw $zero, 12($s0)
				sw $zero, 16($s0)
				sw $zero, 20($s0)
				sw $zero, 24($s0)
				li $t1, 1
				sw $t1, 28($s0)
				sw $zero, 32($s0)
				sw $zero, 36($s0)
				sw $zero, 40($s0)
				sw $zero, 44($s0)
				
				# Reset temp score to level score
				la $t1, LEVEL
				lw $t2, LEV_SCORE($t1)
				sw $t2, TEMP_SCORE($t1)
				
				beq $t3, RESET_KEY, RESET_GAME 
				
				li $t1, 1
				la $t2, LEVEL
				sw $t1, LEVEL_NUM($t2)
				sw $zero, LEV_SCORE($t2)
				sw $zero, TEMP_SCORE($t2)
				
				j RESET_GAME
				
				
	FALL_CHECK:
		lw $t1, 20($s0)
		beq $t1, 1, COLLISION_CHECK # If we are mid-jump, then we can't fall. Jump to COLLISION_CHECK
		
		lw $t1, STATE($s0)
		beq $t1, 2, COLLISION_CHECK # If we are climbing, then we can't fall. Jump to COLLISION_CHECK
		
		li $t2, -8
		
		#Loops through all the pixels underneath the character. If any of them are walkable, then we are
		#on the ground
		FALL_CHECK_LOOP:
		
			beq $t2, 12, FALL_CHECK_END_LOOP
			lw $t1, 0($s0) # Get the colour of the pixel underneath the character
			addi $t1, $t1, 3584
			add $t1, $t0, $t1
			add $t1, $t1, $t2
			lw $t1, 0($t1)
			
			beq $t1, BORDER, ON_GROUND
			beq $t1, PLATFORM, ON_GROUND
			beq $t1, PLATFORMX, ON_GROUND
			
			addi $t2, $t2, 4
			j FALL_CHECK_LOOP
		
		FALL_CHECK_END_LOOP:
		
		
		
		li $t1, -1
		sw $t1, IS_JUMP($s0)
		sw $zero, STATE($s0)
		lw $t1, 0($s0)
		move $a0, $t1
		jal CLEAR_CHARACTER
		
		# Increment the time spent falling
		lw $t2, JUMP_FRAMES($s0)
		addi $t2, $t2, 1
		sw $t2, JUMP_FRAMES($s0)
		
		bge $t2, 4, FALL_CHECK_CONTINUE
		
		AIR_TIME:
			addi $t2, $t2, 1
			sll $t2, $t2, 9
			add $t2, $t2, $t1
			move $a0, $t1
			sw $t1, 0($s0)
			jal DRAW_CHARACTER
			j COLLISION_CHECK
		
		FALL_CHECK_CONTINUE:
		lw $t2, 0($s0) # Get the colour of the pixel 2 pixels underneath the character
		addi $t2, $t2, 4096
		add $t2, $t0, $t2
		lw $t2, 0($t2)
		
		beq $t2, BORDER, FALL_4 # If we are only one pixel above the ground, then fall only 1 pixel
		beq $t2, PLATFORM, FALL_4
		beq $t2, PLATFORMX, FALL_4
		
		lw $t2, DIRECTION($s0)
		beqz $t2, RIGHT_FALL_WALL_CHECK
		
		LEFT_FALL_WALL_CHECK:
		lw $t2, 0($s0) # Get the colour of the pixel to the left of the character
		addi $t2, $t2, -16
		add $t2, $t0, $t2
		lw $t2, 0($t2)
		beq $t2, BORDER, FALL_4 # If we are against a wall to the left, fall slower
		beq $t2, PLATFORM, FALL_4
		beq $t2, PLATFORMX, FALL_4
		
		j FALL_8
		
		RIGHT_FALL_WALL_CHECK:
		lw $t2, 0($s0) # Get the colour of the pixel to the right of the character
		addi $t2, $t2, 16
		add $t2, $t0, $t2
		lw $t2, 0($t2)
		beq $t2, BORDER, FALL_4 # If we are against a wall to the right, fall slower
		beq $t2, PLATFORM, FALL_4
		beq $t2, PLATFORMX, FALL_4
		
			FALL_8: # If we are more than one pixel above the ground, then fall 2 pixels
				addi, $t1, $t1, 1024
				move $a0, $t1
				sw $t1, 0($s0)
				jal DRAW_CHARACTER
				j COLLISION_CHECK
			
			FALL_4:
				addi, $t1, $t1, 512
				move $a0, $t1
				sw $t1, 0($s0)
				jal DRAW_CHARACTER
				j COLLISION_CHECK
		
		ON_GROUND:
			lw $t2, 8($s0)
			li $t1, 1
			sw $t1, DASH_COUNT($s0) #Replenish dash
			sw $zero, IS_JUMP($s0) #Set the jump state to on ground
			beq $t1, $t2, COLLISION_CHECK
			li $t1, 0
			sw $t1, STATE($s0)
			move $a2, $t1
			lw $t1, 0($s0)
			move $a0, $t1
			jal CLEAR_CHARACTER
			jal DRAW_CHARACTER
			
	COLLISION_CHECK:
		li $t7, 0
		lw $t1, STATE($s0)
		beq $t1, 4, DASH_COLLISION_BOX	
		la $t1, CHARACTER_BG
		addi $t2, $t1, 384
		j COLLISION_CHECK_LOOP
		
		DASH_COLLISION_BOX:
			la $t1, CHARACTER_BG
			addi $t1, $t1, 116
			addi $t2, $t1, 128
		
		COLLISION_CHECK_LOOP:
			beq $t1, $t2, STATE_CHECK
 			lw $t4, 0($t1)
			#beq $t4, SPIKES, DEATH
			beqz $t4, DEATH
			beq $t4, 0x0e33030, RUBY
			beq $t4, 0x0bd3535, RUBY
			beq $t4, 0x0ed7777, RUBY
			beq $t4, 0x0e35b5b, RUBY 
			beq $t4, 0x03ecff0, DIAMOND
			
			li $t5, WING_COLOR
			addi $t6, $t5, 12
			
			WING_CHECK_LOOP:
				beq $t5, $t6, WING_CHECK_LOOP_END
				beq $t4, $t5, WINGS_COLLIDE
				addi $t5, $t5, 1
				j WING_CHECK_LOOP
			
			WING_CHECK_LOOP_END:
			lw $t4, STATE($s0)
			beq $t4, 4, COLLISION_CHECK_LOOP_NEXT_ROW_CHECK
			addi $t1, $t1, 4
			j COLLISION_CHECK_LOOP
			
			COLLISION_CHECK_LOOP_NEXT_ROW_CHECK:
				addi $t7, $t7, 1
				blt $t7, 5, COLLISION_CHECK_LOOP
				li $t7, 0
				addi $t1, $t1, 8
				j COLLISION_CHECK_LOOP
				
			DEATH:
				# Reduce # of lives by 1 and reset the level
				bltz $t2, RESET
				la $t1, LEVEL
				lw $t2, 12($t1)
				addi $t2, $t2, -1
				sw $t2, 12($t1)
				li $t1, RESET_KEY
				li $t2, 0xffff0004
				sw $t1, 0($t2)
				j RESET
				
			RUBY:
				# Increase score by 500 and erase ruby
				la $t1, LEVEL
				lw $t2, TEMP_SCORE($t1)
				addi $t2, $t2, 500
				sw $t2, TEMP_SCORE($t1)
				
				lw $a0, POSITION($s0)
				jal CLEAR_CHARACTER
				
				la $t1, LEVEL
				lw $t1, RUBY_LOC($t1)
				add $t1, $t1, $t0
				addi $t2, $t1, -2068
				addi $t3,$t1, 2580
				li $t5, 0
				
				ERASE_RUBY_LOOP:
					bgt $t2, $t3, ERASE_RUBY_END
					li $t4, BACKGROUND
					sw $t4, 0($t2)
					addi $t5, $t5, 1
					beq $t5, 11, ERASE_RUBY_NEXT_ROW
					addi $t2, $t2, 4
					j ERASE_RUBY_LOOP
					
					ERASE_RUBY_NEXT_ROW:
						li $t5, 0
						add $t2, $t2, 472
						j ERASE_RUBY_LOOP
						
				ERASE_RUBY_END:
					lw $a0, POSITION($s0)
					lw $a1, DIRECTION($s0)
					lw $a2, STATE($s0)
					jal DRAW_CHARACTER
					jal UPDATE_SCORE
					j STATE_CHECK
					
			DIAMOND:
				# Increase score by 1000, level by 1, and erase diamond
				la $t1, LEVEL
				lw $t2, TEMP_SCORE($t1)
				addi $t2, $t2, 1000
				sw $t2, TEMP_SCORE($t1)
				sw $t2, LEV_SCORE($t1)
				
				lw $t2, LEVEL_NUM($t1)
				addi $t2, $t2, 1
				sw $t2, LEVEL_NUM($t1)
				
				lw $a0, POSITION($s0)
				jal CLEAR_CHARACTER
				
				la $t1, LEVEL
				lw $t1, DIAMOND_LOC($t1)
				add $t1, $t1, $t0
				addi $t2, $t1, -2068
				addi $t3,$t1, 2580
				li $t5, 0
				
				ERASE_DIAMOND_LOOP:
					bgt $t2, $t3, ERASE_DIAMOND_END
					li $t4, BACKGROUND
					sw $t4, 0($t2)
					addi $t5, $t5, 1
					beq $t5, 11, ERASE_DIAMOND_NEXT_ROW
					addi $t2, $t2, 4
					j ERASE_DIAMOND_LOOP
					
					ERASE_DIAMOND_NEXT_ROW:
						li $t5, 0
						add $t2, $t2, 472
						j ERASE_DIAMOND_LOOP
						
				ERASE_DIAMOND_END:
					lw $a0, POSITION($s0)
					lw $a1, DIRECTION($s0)
					lw $a2, STATE($s0)
					jal DRAW_CHARACTER
					li $t1, RESET_KEY
					li $t2, 0xffff0004
					sw $t1, 0($t2)
					j RESET
					
			WINGS_COLLIDE:
			
				lw $t5, DASH_COUNT($s0)
				bnez $t5, STATE_CHECK
				addi $sp, $sp, -4
				sw $t4, 0($sp)
				
				lw $a0, POSITION($s0)
				jal CLEAR_CHARACTER
				
				lw $t4, 0($sp)
				addi $sp, $sp, 4
				
				subi $t4, $t4, WING_COLOR
				sll $t4, $t4, 2
				la $t5, WINGS_TIMER
				add $t5, $t4, $t5
				li $t6, WING_RESPAWN_TIME
				sw $t6, 0($t5)
				la $t5, WINGS_LOC
				add $t5, $t4, $t5
				lw $t4, 0($t5)
				
				add $t1, $t4, $t0
				addi $t2, $t1, -2068
				addi $t3,$t1, 3092
				li $t5, 0
				
				ERASE_WINGS_LOOP:
					bgt $t2, $t3, ERASE_WINGS_END
					li $t4, BACKGROUND
					sw $t4, 0($t2)
					addi $t5, $t5, 1
					beq $t5, 11, ERASE_WINGS_NEXT_ROW
					addi $t2, $t2, 4
					j ERASE_WINGS_LOOP
					
					ERASE_WINGS_NEXT_ROW:
						li $t5, 0
						add $t2, $t2, 472
						j ERASE_WINGS_LOOP
				
				ERASE_WINGS_END:
				lw $a0, POSITION($s0)
				lw $a1, DIRECTION($s0)
				lw $a2, STATE($s0)
				li $t1, 1
				sw $t1, DASH_COUNT($s0)
				jal DRAW_CHARACTER
				
				j STATE_CHECK
								
	STATE_CHECK:
		lw $t1, 8($s0) # Get the current state
		lw $t2, 12($s0) # Get the previous state
		
		beq $t1, $t2 SAME_STATE # If this frame's state is the same as last frame's state, increment the state counter
		sw $zero, 16($s0) # If the state has changed, reset the state counter to 0
		j NEXT_FRAME
		
			SAME_STATE:
				lw $t2, 16($s0) # Get the current state count
				addi $t2, $t2, 1 # Increment it by 1
				sw $t2, 16($s0) # Store the incremented state count
			
	NEXT_FRAME:
		
		sw $t1, 12($s0) # Set the current state in the previous state slot for the next frame
		# Wait FRAME_RATE ms before the next frame
		li $v0, 32
		li $a0, FRAME_RATE
		syscall
		j MAIN_GAME_LOOP	
		
# Uses the info stored in CHARACTER_BG to redraw the background that was covered by the character
CLEAR_CHARACTER:
	addi $t8, $a0, -3084 # Locates the top left corner of the 7x13 area around the character and stores it in $t1
	addi $t2, $a0, 3088 # Locates the bottom right corner of the 13x13 area and stores it in $t2
	li $t3, 0 # Initializes $t3 to 0. This will be used to make sure that the loop goes down to the next row after 7 pixels
	la $t4, CHARACTER_BG # Initializes $t4 to address of CHARACTER_BG. This will keep track of where we are in the array
	
	CLEAR_CHARACTER_LOOP:
			beq $t8, $t2, CLEAR_CHARACTER_END # End the loop once we reach the bottom left corner
			add $t5, $t0, $t8 # Store the address of the pixel we are looking at in $t5
			lw $t6, 0($t4) # Store the colour of the pixel at CHARACTER_BG[i] in $t6
			#li $t6, 0x0000000 
			sw $t6, 0($t5) # Store the colour of the pixel at CHARACTER_BG[i] into the address of the pixel
			addi $t4, $t4, 4 # Go the the next element in CHARACTER_BG
			beq $t3, 7, CLEAR_CHARACTER_NEXT_ROW # If we have stored 13 pixels, we need to go to the next row
			addi $t3, $t3, 1 # Increment $t3
			addi $t8, $t8, 4 # Go the the next pixel
			j CLEAR_CHARACTER_LOOP
		
			CLEAR_CHARACTER_NEXT_ROW:
				li $t3, 0 # Reset $t3
				addi $t8, $t8, 484 # Go the the next row - 7 pixels
				j CLEAR_CHARACTER_LOOP
	
CLEAR_CHARACTER_END:
	jr $ra
	


# Draws the character. Has 3 parameters: 
# $a0 holds coordinates
# $a1 holds 0 or 1. 0 means character should be drawn looking right, 1 is looking left
# $a2 holds 0, 1, or 2. Signifies state. 0 means idle, 1 means running, 2 means jumping
DRAW_CHARACTER:

	lw $t1, DASH_COUNT($s0)
	bnez $t1, RED_HAIR
	li $t8, 0x09badb7
	li $t9, 0x0ffffff
	j SAVE_BG
	
	RED_HAIR:
		li $t8, 0x0ac3232
		li $t9, 0x0d95763

	# Takes the current location of the character, and stores the colour info about the 13x13 location around her
	# in the array CHARACTER_BG	
	SAVE_BG:
		addi $t1, $a0, -3084 # Locates the top left corner of the 7x13 area and stores it in $t1
		addi $t2, $a0, 3088 # Locates the bottom right corner of the 13x13 area and stores it in $t2
		li $t3, 0 # Initializes $t3 to 0. This will be used to make sure that the loop goes down to the next row after 13 pixels
		la $t4, CHARACTER_BG # Initializes $t4 to address of CHARACTER_BG. This will keep track of where we are in the array
	
		SAVE_BG_LOOP:
			beq $t1, $t2, SAVE_BG_END # End the loop once we reach the bottom left corner
			add $t5, $t0, $t1 # Store the address of the pixel we are looking at in $t5
			lw $t6, 0($t5) # Store the colour of the pixel we are looking at in $t6
			sw $t6, 0($t4) # Store the colour of the pixel we are looking at into CHARACTER_BG[i]
			addi $t4, $t4, 4 # Go the the next element in CHARACTER_BG
			beq $t3, 7, SAVE_BG_LOOP_NEXT_ROW # If we have stored 7 pixels, we need to go to the next row
			addi $t3, $t3, 1 # Increment $t3
			addi $t1, $t1, 4 # Go the the next pixel
			j SAVE_BG_LOOP
		
			SAVE_BG_LOOP_NEXT_ROW:
				li $t3, 0 # Reset $t3
				addi $t1, $t1, 484 # Go the the next row - 7 pixels
				j SAVE_BG_LOOP
	
	SAVE_BG_END:
		lw $t2, STATE($s0)
		beq $t2, 4, DRAW_CHARACTER_DASH
		
		li $t4, 0x0006600
		li $t5, 0x03399ff
