# Draws a rectangular pillar. 
# $a0 specifies location of top left corner
# $a1 specifies width
# $a2 specifies height
# $a3 specifies color (PLATFORM-regular, 0x0ffffff-special)	
		
DRAW_PILLAR:
	move $t1, $a3
	# Stores the location of the current pixel
	move $t2, $t0
	add $t2, $t2, $a0
	
	li $t3, 0 # Stores the row we are on
	li $t4, 0 # Stores the column we are on
	 
	DRAW_PILLAR_LOOP:
		beq $t3, $a2, DRAW_PILLAR_END
		sw $t1, 0($t2)
		addi $t4, $t4, 1
		beq $t4, $a1, DRAW_PILLAR_NEXT_ROW
		addi $t2, $t2, 4
		j DRAW_PILLAR_LOOP
		
		DRAW_PILLAR_NEXT_ROW:
			li $t4, 0
			addi $t3, $t3, 1
			# Go to the next row (512 - WIDTH * 4)
			sll $t5, $a1, 2
			li $t6, 516
			sub $t5, $t6, $t5 
			add $t2, $t2, $t5
			j DRAW_PILLAR_LOOP	
DRAW_PILLAR_END:
jr $ra

